import React from 'react';
import { motion } from 'framer-motion';
import { User, Target, Heart, Zap } from 'lucide-react';

const About: React.FC = () => {
  const values = [
    {
      icon: <Target size={24} />,
      title: 'User-Centered',
      description: 'Every design decision starts with understanding user needs and behaviors.'
    },
    {
      icon: <Heart size={24} />,
      title: 'Empathetic',
      description: 'I believe in creating experiences that truly connect with people on an emotional level.'
    },
    {
      icon: <Zap size={24} />,
      title: 'Innovative',
      description: 'Pushing boundaries while maintaining usability and accessibility standards.'
    }
  ];

  return (
    <section id="about" className="section bg-background-secondary">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl font-bold text-text-primary mb-4">
            About Me
          </h2>
          <p className="text-text-secondary text-lg max-w-2xl mx-auto">
            A passionate product designer with a love for creating meaningful digital experiences
          </p>
        </motion.div>

        <div className="grid lg:grid-cols-2 gap-12 items-center">
          {/* Left Column - Personal Info */}
          <motion.div
            initial={{ opacity: 0, x: -30 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            <div className="bg-white rounded-2xl p-8 shadow-lg">
              <div className="flex items-center mb-6">
                <div className="w-12 h-12 bg-primary-color rounded-lg flex items-center justify-center mr-4">
                  <User size={24} className="text-white" />
                </div>
                <h3 className="text-xl font-semibold text-text-primary">Who I Am</h3>
              </div>

              <p className="text-text-secondary mb-6 leading-relaxed">
                I'm a product designer with over 5 years of experience crafting digital experiences 
                that users love. My journey started with a fascination for how people interact with 
                technology, and it's evolved into a passion for creating intuitive, beautiful, and 
                functional products.
              </p>

              <p className="text-text-secondary mb-6 leading-relaxed">
                I believe that great design is invisible - it should feel natural and effortless. 
                My approach combines user research, strategic thinking, and creative problem-solving 
                to deliver solutions that not only meet business goals but exceed user expectations.
              </p>

              <p className="text-text-secondary leading-relaxed">
                When I'm not designing, you'll find me exploring new technologies, reading about 
                human psychology, or sharing knowledge with the design community.
              </p>
            </div>
          </motion.div>

          {/* Right Column - Values */}
          <motion.div
            initial={{ opacity: 0, x: 30 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="space-y-6"
          >
            <h3 className="text-2xl font-semibold text-text-primary mb-8">
              My Design Philosophy
            </h3>

            {values.map((value, index) => (
              <motion.div
                key={value.title}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
                className="bg-white rounded-xl p-6 shadow-md hover:shadow-lg transition-shadow duration-200"
              >
                <div className="flex items-start">
                  <div className="w-10 h-10 bg-primary-color/10 rounded-lg flex items-center justify-center mr-4 mt-1">
                    <div className="text-primary-color">
                      {value.icon}
                    </div>
                  </div>
                  <div>
                    <h4 className="text-lg font-semibold text-text-primary mb-2">
                      {value.title}
                    </h4>
                    <p className="text-text-secondary leading-relaxed">
                      {value.description}
                    </p>
                  </div>
                </div>
              </motion.div>
            ))}
          </motion.div>
        </div>

        {/* Stats Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
          className="mt-16 grid grid-cols-2 md:grid-cols-4 gap-8"
        >
          <div className="text-center">
            <div className="text-3xl md:text-4xl font-bold text-primary-color mb-2">5+</div>
            <div className="text-text-secondary">Years Experience</div>
          </div>
          <div className="text-center">
            <div className="text-3xl md:text-4xl font-bold text-primary-color mb-2">50+</div>
            <div className="text-text-secondary">Projects Completed</div>
          </div>
          <div className="text-center">
            <div className="text-3xl md:text-4xl font-bold text-primary-color mb-2">15+</div>
            <div className="text-text-secondary">Happy Clients</div>
          </div>
          <div className="text-center">
            <div className="text-3xl md:text-4xl font-bold text-primary-color mb-2">3</div>
            <div className="text-text-secondary">Design Awards</div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
